import React from "react";

const Resume = () => {
  return (
    <div className="mt-32 h-screen bg-[#E6DACE] ">
      <div className=" w-[50%] my-0 mx-auto bg-green-400 flex flex-col items-center h-screen">
        <div className="flex items-center gap-3 mt-7">
          <div className="w-4 h-4 bg-blue-800"></div>
          <h1>RESUME</h1>
        </div>

        <div className="flex gap-5">
          <p>Experience</p>
          <button>DOWNLOAD CV</button>
        </div>
      </div>
    </div>
  );
};

export default Resume;
